   insts[v[1]][prop] = val\r\n            end\r\n        end\r\n    end\r\n\r\n    return insts[1]\r\nend\r\n\r\nlocal textService = game:GetService(\"TextService\")\r\nViewportTextBox = (function()\r\n\r\n    local funcs = {}\r\n    funcs.Update = function(self)\r\n        local cursorPos = self.TextBox.CursorPosition\r\n        local text = self.TextBox.Text\r\n        if text == \"\" then self.TextBox.Position = UDim2.new(0,2,0,0) return end\r\n        if cursorPos == -1 then return end\r\n\r\n        local cursorText = text:sub(1,cursorPos-1)\r\n        local pos = nil\r\n        local leftEnd = -self.TextBox.Position.X.Offset\r\n        local rightEnd = leftEnd + self.View.AbsoluteSize.X\r\n\r\n        local totalTextSize = textService:GetTextSize(text,self.TextBox.TextSize,self.TextBox.Font,Vector2.new(999999999,100)).X\r\n        local cursorTextSize = textService:GetTextSize(cursorText,self.TextBox.TextSize,self.TextBox.Font,Vector2.new(999999999,100)).X\r\n\r\n        if cursorTextSize > rightEnd then\r\n            pos = math.max(-2,cursorTextSize - self.View.AbsoluteSize.X + 2)\r\n        elseif cursorTextSize \u003C leftEnd then\r\n            pos = math.max(-2,cursorTextSize-2)\r\n        elseif totalTextSize \u003C rightEnd then\r\n            pos = math.max(-2,totalTextSize - self.View.AbsoluteSize.X + 2)\r\n        end\r\n\r\n        if pos then\r\n            self.TextBox.Position = UDim2.new(0,-pos,0,0)\r\n            self.TextBox.Size = UDim2.new(1,pos,1,0)\r\n        end\r\n    end\r\n\r\n    local mt = {}\r\n    mt.__index = funcs\r\n\r\n    local function convert(textbox)\r\n        local obj = setmetatable({OffsetX = 0, TextBox = textbox},mt)\r\n\r\n        local view = Instance.new(\"Frame\")\r\n        view.BackgroundTransparency = textbox.BackgroundTransparency\r\n        view.BackgroundColor3 = textbox.BackgroundColor3\r\n        view.BorderSizePixel = textbox.BorderSizePixel\r\n        view.BorderColor3 = textbox.BorderColor3\r\n        view.Position = textbox.Position\r\n        view.Size = textbox.Size\r\n        view.ClipsDescendants = true\r\n        view.Name = textbox.Name\r\n        view.ZIndex = 10\r\n        textbox.BackgroundTransparency = 1\r\n        textbox.Position = UDim2.new(0,4,0,0)\r\n        textbox.Size = UDim2.new(1,-8,1,0)\r\n        textbox.TextXAlignment = Enum.TextXAlignment.Left\r\n        textbox.Name = \"Input\"\r\n        table.insert(text1,textbox)\r\n        table.insert(shade2,view)\r\n\r\n        obj.View = view\r\n\r\n        textbox.Changed:Connect(function(prop)\r\n            if prop == \"Text\" or prop == \"CursorPosition\" or prop == \"AbsoluteSize\" then\r\n                obj:Update()\r\n            end\r\n        end)\r\n\r\n        obj:Update()\r\n\r\n        view.Parent = textbox.Parent\r\n        textbox.Parent = view\r\n\r\n        return obj\r\n    end\r\n\r\n    return {convert = convert}\r\nend)()\r\n\r\nViewportTextBox.convert(Cmdbar).View.ZIndex = 10\r\nViewportTextBox.convert(Cmdbar_2).View.ZIndex = 10\r\nViewportTextBox.convert(Cmdbar_3).View.ZIndex = 10\r\n\r\nIYMouse = Players.LocalPlayer:GetMouse()\r\nUserInputService = game:GetService(\"UserInputService\")\r\nTweenService = game:GetService(\"TweenService\")\r\nHttpService = game:GetService(\"HttpService\")\r\nMarketplaceService = game:GetService(\"MarketplaceService\")\r\nRunService = game:GetService(\"RunService\")\r\nTeleportService = game:GetService(\"TeleportService\")\r\nStarterGui = game:GetService(\"StarterGui\")\r\nGuiService = game:GetService(\"GuiService\")\r\nLighting = game:GetService(\"Lighting\")\r\nContextActionService = game:GetService(\"ContextActionService\")\r\nNetworkClient = game:GetService(\"NetworkClient\")\r\nReplicatedStorage = game:GetService(\"ReplicatedStorage\")\r\nGroupService = game:GetService(\"GroupService\")\r\nPathService = game:GetService(\"PathfindingService\")\r\nSoundService = game:GetService(\"SoundService\")\r\nTeams = game:GetService(\"Teams\")\r\nStarterPlayer = game:GetService(\"StarterPlayer\")\r\nInsertService = game:GetService(\"InsertService\")\r\nChatService = game:GetService(\"Chat\")\r\nProximityPromptService = game:GetService(\"ProximityPromptService\")\r\nStatsService = game:GetService(\"Stats\")\r\nMaterialService = game:GetService(\"MaterialService\")\r\nAvatarEditorService = game:GetService(\"AvatarEditorService\")\r\n\r\nlocal sethidden = sethiddenproperty or set_hidden_property or set_hidden_prop\r\nlocal gethidden = gethiddenproperty or get_hidden_property or get_hidden_prop\r\nlocal queueteleport = (syn and syn.queue_on_teleport) or queue_on_teleport or (fluxus and fluxus.queue_on_teleport)\r\nlocal httprequest = (syn and syn.request) or (http and http.request) or http_request or (fluxus and fluxus.request) or request\r\nlocal PlaceId, JobId = game.PlaceId, game.JobId\r\nlocal clipBoard = setclipboard or toclipboard or set_clipboard or (Clipboard and Clipboard.set)\r\nlocal IsOnMobile = UserInputService.TouchEnabled and not (UserInputService.KeyboardEnabled and UserInputService.GamepadEnabled and GuiService:IsTenFootInterface())\r\nlocal TeleportCheck = false\r\n\r\nfunction writefileSoftware()\r\n    if writefile then\r\n        return true\r\n    end\r\nend\r\n\r\nfunction isNumber(str)\r\n    if tonumber(str) ~= nil or str == 'inf' then\r\n        return true\r\n    end\r\nend\r\n\r\nfunction getRoot(char)\r\n    local rootPart = char:FindFirstChild('HumanoidRootPart') or char:FindFirstChild('Torso') or char:FindFirstChild('UpperTorso')\r\n    return rootPart\r\nend\r\n\r\nfunction tools(plr)\r\n    if plr:FindFirstChildWhichIsA(\"Backpack\"):FindFirstChildWhichIsA('Tool') or plr.Character:FindFirstChildWhichIsA('Tool') then\r\n        return true\r\n    end\r\nend\r\n\r\nfunction r15(plr)\r\n    if plr.Character:FindFirstChildWhichIsA('Humanoid').RigType == Enum.HumanoidRigType.R15 then\r\n        return true\r\n    end\r\nend\r\n\r\nfunction toClipboard(String)\r\n    if clipBoard then\r\n        clipBoard(String)\r\n        notify('Clipboard','Copied to clipboard')\r\n    else\r\n        notify('Clipboard',\"Your Software doesn't have the ability to use the clipboard\")\r\n    end\r\nend\r\n\r\nfunction getHierarchy(obj)\r\n    local fullname\r\n    local period\r\n\r\n    if string.find(obj.Name,' ') then\r\n        fullname = '[\"'..obj.Name..'\"]'\r\n        period = false\r\n    else\r\n        fullname = obj.Name\r\n        period = true\r\n    end\r\n\r\n    local getS = obj\r\n    local parent = obj\r\n    local service = ''\r\n\r\n    if getS.Parent ~= game then\r\n        repeat\r\n            getS = getS.Parent\r\n            service = getS.ClassName\r\n        until getS.Parent == game\r\n    end\r\n\r\n    if parent.Parent ~= getS then\r\n        repeat\r\n            parent = parent.Parent\r\n            if string.find(tostring(parent),' ') then\r\n                if period then\r\n                    fullname = '[\"'..parent.Name..'\"].'..fullname\r\n                else\r\n                    fullname = '[\"'..parent.Name..'\"]'..fullname\r\n                end\r\n                period = false\r\n            else\r\n                if period then\r\n                    fullname = parent.Name..'.'..fullname\r\n                else\r\n                    fullname = parent.Name..''..fullname\r\n                end\r\n                period = true\r\n            end\r\n        until parent.Parent == getS\r\n    elseif string.find(tostring(parent),' ') then\r\n        fullname = '[\"'..parent.Name..'\"]'\r\n        period = false\r\n    end\r\n\r\n    if period then\r\n        return 'game:GetService(\"'..service..'\").'..fullname\r\n    else\r\n        return 'game:GetService(\"'..service..'\")'..fullname\r\n    end\r\nend\r\n\r\nAllWaypoints = {}\r\n\r\nlocal cooldown = false\r\nfunction writefileCooldown(name,data)\r\n    task.spawn(function()\r\n        if not cooldown then\r\n            cooldown = true\r\n            writefile(name, data)\r\n        else\r\n            repeat wait() until cooldown == false\r\n            writefileCooldown(name,data)\r\n        end\r\n        wait(3)\r\n        cooldown = false\r\n    end)\r\nend\r\n\r\nfunction dragGUI(gui)\r\n    task.spawn(function()\r\n        local dragging\r\n        local dragInput\r\n        local dragStart = Vector3.new(0,0,0)\r\n        local startPos\r\n        local function update(input)\r\n            local delta = input.Position - dragStart\r\n            local Position = UDim2.new(startPos.X.Scale, startPos.X.Offset + delta.X, startPos.Y.Scale, startPos.Y.Offset + delta.Y)\r\n            TweenService:Create(gui, TweenInfo.new(.20), {Position = Position}):Play()\r\n        end\r\n        gui.InputBegan:Connect(function(input)\r\n            if input.UserInputType == Enum.UserInputType.MouseButton1 or input.UserInputType == Enum.UserInputType.Touch then\r\n                dragging = true\r\n                dragStart = input.Position\r\n                startPos = gui.Position\r\n\r\n                input.Changed:Connect(function()\r\n                    if input.UserInputState == Enum.UserInputState.End then\r\n                        dragging = false\r\n                    end\r\n                end)\r\n            end\r\n        end)\r\n        gui.InputChanged:Connect(function(input)\r\n            if input.UserInputType == Enum.UserInputType.MouseMovement or input.UserInputType == Enum.UserInputType.Touch then\r\n                dragInput = input\r\n            end\r\n        end)\r\n        UserInputService.InputChanged:Connect(function(input)\r\n            if input == dragInput and dragging then\r\n                update(input)\r\n            end\r\n        end)\r\n    end)\r\nend\r\n\r\ndragGUI(logs)\r\ndragGUI(KeybindEditor)\r\ndragGUI(PluginEditor)\r\ndragGUI(ToPartFrame)\r\n\r\neventEditor = (function()\r\n    local events = {}\r\n\r\n    local function registerEvent(name,sets)\r\n        events[name] = {\r\n            commands = {},\r\n            sets = sets or {}\r\n        }\r\n    end\r\n\r\n    local onEdited = nil\r\n\r\n    local function fireEvent(name,...)\r\n        local args = {...}\r\n        local event = events[name]\r\n        if event then\r\n            for i,cmd in pairs(event.commands) do\r\n                local metCondition = true\r\n                for idx,set in pairs(event.sets) do\r\n                    local argVal = args[idx]\r\n                    local cmdSet = cmd[2][idx]\r\n                    local condType = set.Type\r\n                    if condType == \"Player\" then\r\n                        if cmdSet == 0 then\r\n                            metCondition = metCondition and (tostring(Players.LocalPlayer) == argVal)\r\n                        elseif cmdSet ~= 1 then\r\n                            metCondition = metCondition and table.find(getPlayer(cmdSet,Players.LocalPlayer),argVal)\r\n                        end\r\n                    elseif condType == \"String\" then\r\n                        if cmdSet ~= 0 then\r\n                            metCondition = metCondition and string.find(argVal:lower(),cmdSet:lower())\r\n                        end\r\n                    elseif condType == \"Number\" then\r\n                        if cmdSet ~= 0 then\r\n                            metCondition = metCondition and tonumber(argVal)\u003C=tonumber(cmdSet)\r\n                        end\r\n                    end\r\n                    if not metCondition then break end\r\n                end\r\n\r\n                if metCondition then\r\n                    pcall(task.spawn(function()\r\n                        local cmdStr = cmd[1]\r\n                        for count,arg in pairs(args) do\r\n                            cmdStr = cmdStr:gsub(\"%$\"..count,arg)\r\n                        end\r\n                        wait(cmd[3] or 0)\r\n                        execCmd(cmdStr)\r\n                    end))\r\n                end\r\n            e